class Solution {

    /**
     * @param String $s
     * @param Integer $k
     * @return Integer
     */
    function beautifulSubstrings($s, $k) {
        $beautifulCount = 0;
        $length = strlen($s);

        for ($i = 0; $i < $length; $i++) {
            for ($j = $i; $j < $length; $j++) {
                $substring = substr($s, $i, $j - $i + 1);
                $vowels = 0;
                $consonants = 0;

                // Count vowels and consonants
                for ($k = 0, $subLen = strlen($substring); $k < $subLen; $k++) {
                    if (strpos('aeiou', $substring[$k]) !== false) {
                        $vowels++;
                    } else {
                        $consonants++;
                    }
                }

                // Check if substring is beautiful
                if ($vowels == $consonants && ($vowels * $consonants) % $k == 0) {
                    $beautifulCount++;
                }
            }
        }

        return $beautifulCount;
    }
}
